import { Button, Container, Content, Form, Input, Page, Title } from "./styled";

export default function Login() {
  return (
    <Page>
      <Content>
        <Title>Вход</Title>
        <Form>
          <Input placeholder="Логин" />
          <Input placeholder="Пароль" />
          <Container>
            <Button type="submit" $white>
              Войти
            </Button>
            <Button $width="210px">Регистрация</Button>
          </Container>
        </Form>
      </Content>
    </Page>
  );
}
